DROP TABLE IF EXISTS `t_device`;
CREATE TABLE `t_device` (
  `DEVICE_ID` varchar(200) NOT NULL COMMENT '设备SN',
  `DEVICE_NAME` varchar(50) NOT NULL COMMENT '设备名称',
  `INDEX_CODE` varchar(255) DEFAULT NULL COMMENT '设备唯一编码  和设备号区分',
  `DEVICE_TYPE` varchar(50) DEFAULT NULL COMMENT '设备型号',
  `TYPE` tinyint(1) DEFAULT NULL COMMENT '设备类型：0 摄像头 1 大喇叭',
  `REMARK` varchar(255) DEFAULT NULL COMMENT '备注',
  `AREA_ID` varchar(255) DEFAULT NULL COMMENT '设备所属片区ID',
  `LON` decimal(10,7) DEFAULT NULL COMMENT '经度',
  `LAT` decimal(10,7) DEFAULT NULL COMMENT '纬度',
  `ADDRESS` varchar(255) DEFAULT NULL COMMENT '设备地址',
  `BIND_DEVICE` varchar(200) DEFAULT NULL COMMENT '绑定的设备SN',
  `STATUS` char(4) DEFAULT NULL COMMENT '设备状态',
  `BIND_TIME` datetime DEFAULT NULL COMMENT '绑定时间',
  `MODIFY_TIME` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`DEVICE_ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

