-- ----------------------------
-- Table structure for t_event
-- ----------------------------
DROP TABLE IF EXISTS `t_event`;
CREATE TABLE `t_event` (
  `CASE_NUMBER` varchar(100) NOT NULL COMMENT '事件编号',
  `VIDEO_ID` varchar(100) DEFAULT NULL COMMENT '视频编号',
  `DEVICE_ID` varchar(100) NOT NULL COMMENT '设备号',
  `DEVICE_NAME` varchar(100) NOT NULL COMMENT '设备名称',
  `CASE_IMAGE_URI` varchar(255) DEFAULT NULL COMMENT '告警图URI',
  `CHECK_IMAGE_URI` varchar(255) DEFAULT NULL COMMENT '核查图URI',
  `CASE_VIDEO_URI` varchar(255) DEFAULT NULL COMMENT '告警视频URI',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '告警时间',
  `ADDRESS` varchar(100) DEFAULT NULL COMMENT '告警地点',
  `LON` decimal(10,7) DEFAULT NULL COMMENT '经度',
  `LAT` decimal(10,7) DEFAULT NULL COMMENT '维度',
  `TYPE` varchar(10) DEFAULT NULL COMMENT '告警类型',
  `DESCRIPTION` varchar(255) DEFAULT NULL COMMENT '问题描述',
  `REPORT` tinyint(1) DEFAULT NULL COMMENT '0 未上报 1 已上报',
  `AREA_ID` varchar(100) DEFAULT NULL COMMENT '事件发生地所属片区',
  PRIMARY KEY (`CASE_NUMBER`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

