DROP TABLE IF EXISTS `t_collectandedit_app`;
CREATE TABLE `t_collectandedit_app` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `state` varchar(20) DEFAULT NULL COMMENT '审核状态1代表已审核 0代表未审核',
  `leader_id` varchar(255) DEFAULT NULL COMMENT '呈报领导id',
  `report_time` datetime DEFAULT NULL COMMENT '呈报时间',
  `opinion` varchar(255) DEFAULT NULL COMMENT '备注',
  `title` varchar(255) DEFAULT NULL COMMENT '详情标题',
  `position` varchar(255) DEFAULT NULL COMMENT '位置',
  `category_name` varchar(255) DEFAULT NULL COMMENT '类别',
  `picture_url` varchar(255) DEFAULT NULL,
  `category_code` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

